def digits(n, b=10): # digits of n in base 2 <= b <= 62
    x, y = n, ''
    while x >= b:
        x, r = divmod(x,b)
        y += str(r) if r < 10 else (chr(r+87) if r < 36 else chr(r+29))
    y += str(x) if x < 10 else (chr(x+87) if x < 36 else chr(x+29))
    return y[::-1]
